import React, { Component } from 'react';
import './PrevWOD.css'

class PrevWOD extends Component {
    render() {
        const { name, workout, category, score } = this.props.workout
        return (
            <>
                <div class="card">
                    <h2 class="title">"{name}"</h2>
                    <div class="bar">
                    <h3>Score :{score}</h3>
                    </div>
                    <div class="circle">
                    </div>
                </div>
            </>
        );
    }
}

export default PrevWOD;

